import React from 'react'
import DonutChart from 'react-donut-chart'

function Chart({ label, value }) {
    return (
        <DonutChart
            data={[
                {
                    label,
                    value
                },
                {
                    label: '',
                    value: 1 - value,
                    isEmpty: true
                }
            ]}
        />
    )
}

export default Chart
